import React from "react";
import {
  Row,
  Col,
  Image,
  Container,
  Card,
  Button,
  Form,
} from "react-bootstrap";
const FormContainer = ({ children }) => {
  return (
    <div>
      <Container>
        <Row className="justify-content-md-center">
          <Col>{children}</Col>
        </Row>
      </Container>
    </div>
  );
};

export default FormContainer;
